const puppeteer = async ()=>{
    const delay = ms => new Promise(resolve => setTimeout(resolve, ms))
    await delay(8000)
    return "https://www.youtube.com/embed/3vYeQLJ2as4?autoplay=1"
}

export default puppeteer;
